import groovy.json.JsonSlurper
def response = context.expand( '${searchLecture#Response#$.ResponseData}' );
def list = new JsonSlurper().parseText( response )
def objectSize = list.size();
def totalAttendees1 = context.expand( '${searchLecture#Response#$.ResponseData[0].totalAttendees}' )
for( int i=0;i<objectSize;i++)
{

def totalAttendees = context.expand( '${searchLecture#Response#$.ResponseData['+i+'].totalAttendees}' )
def maxAttendees = context.expand( '${searchLecture#Response#$.ResponseData['+i+'].maxAttendees}' )
//log.info("totAttendies "+totalAttendees+"  maxattendies"+maxAttendees);
	if(totalAttendees<maxAttendees)
	{
		def lectureId = context.expand( '${searchLecture#Response#$.ResponseData['+i+'].id}' )
		def startDtTime = context.expand( '${searchLecture#Response#$.ResponseData['+i+'].startDtTime}' )

		testRunner.testCase.testSteps["Property"].setPropertyValue( "lectureEventId",lectureId.toString()  )
		testRunner.testCase.testSteps["Property"].setPropertyValue( "lectureStartDtTime",startDtTime.toString()  )
		break;
	}
}

